import React, {useEffect, useState} from 'react';
import Header from "./include/nav_user";

import {Button} from 'react-bootstrap';
import Carousel from 'react-bootstrap/Carousel';

function Home() {
    const [cars, setCars] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8000/api/carData')
            .then(response => response.json())
            .then(data => setCars(data))
            .catch(error => console.log(error));
    }, []);
    return (
        <div>
            <Header/>
            <Carousel>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src="img/car1.jpg"
                        alt="First slide"
                    />
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src="img/car2.jpg"
                        alt="Second slide"
                    />
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src="img/car3.jpg"
                        alt="Third slide"
                    />
                </Carousel.Item>
            </Carousel>
            <h3 className="font-italic text-center p-4 bg-dark text-light">Rent Your Dream Car !! With ZoomCar</h3>
            <Carousel>
                <Carousel.Item>

                    {cars.map((car) => (
                        <div>
                            <img
                                className="d-block w-100"
                                src={`http://localhost:8000/storage/images/${car.image}`}
                                alt={car.brand}
                            />
                            <h3>{car.brand}</h3>
                            <p>{car.price}</p>
                            <Button variant="primary" href="/rent">
                                Rent Now
                            </Button>
                        </div>
                    ))}
                </Carousel.Item>
            </Carousel>

        </div>
    );
}

export default Home;
